import React from 'react';

class AddFishForm extends React.Component {
    render() {
        return (
            <div className="inventory">
                <h2> Inventory </h2>
                <form>
                    <p>It works!</p> 
                </form>
            </div>

            );
    }
}

export default AddFishForm;
